<?php

/**
 * Leetcode 649 implemented with SPL Queue
 *
 * This solution simplifies the senator validation, so now it does not cause Time Limit Exceeded
 */
class Solution {

    /**
     * @param String $senate
     * @return String
     */
    function predictPartyVictory($senate) {
        $radiant = new SplQueue();
        $dire = new SplQueue();

        $senate = str_split($senate);

        foreach ($senate as $key => $senator) {
            if ($senator == 'R') {
                $radiant->enqueue($key);
            } else if($senator == 'D') {
                $dire->enqueue($key);
            }
        }

        while(!$radiant->isEmpty() && !$dire->isEmpty()) {
            foreach ($senate as $key => $senator) {
                if ($dire->isEmpty() || $radiant->isEmpty()) break;

                if ($senator == 'R' && $key === $radiant->bottom()) {
                    if (!$dire->isEmpty()) $dire->dequeue();
                    $radiant->dequeue();
                    $radiant->enqueue($key);
                }
                if ($senator == 'D' && $key === $dire->bottom()) {
                    if (!$radiant->isEmpty()) $radiant->dequeue();
                    $dire->dequeue();
                    $dire->enqueue($key);
                }
            }
        }

        if ($radiant->isEmpty()) return 'Dire';
        return 'Radiant';
    }
}

